(138, 19, '_edit_last', '3'),
(139, 19, 'first_quote', 'Something seen or remembered is the starting point. From there, painting is a process of discovery and arrival. Nuance of tone,\r\nexpression and the handling of materials are among those elements key to the work. It is important that the finished painting have a\r\nvisual “lastingness”, such that the work continues to resonate over time.'),
(140, 19, '_first_quote', 'field_60a7e7aee9951'),
(141, 19, 'artist_name', 'Stephen Dinsmore'),
(142, 19, '_artist_name', 'field_60a7efb957074'),
(143, 19, 'city_of_birth', 'Lincoln, Nebraska'),
(144, 19, '_city_of_birth', 'field_60a7effc57075'),
(145, 19, 'second_quote', 'For me painting means being always on the lookout for an image/idea that excites.\r\n\r\nSounds straightforward but it’s nothing like a straight line. So many things count: the creamy light of late\r\nafternoon on landscape; the abstract beauty of marks on the side of a train car; new snow that reshapes all it\r\ntouches; an interior filled with color and reverie; the riveting beauty of a vase of flowers; a fly fisherman in\r\nshadow; a disregarded corner of town; a found image...\r\nI try to make a painting that has in it at least something of the magic and mystery of the thing; the alchemy;\r\nthe thing that excites.'),
(146, 19, '_second_quote', 'field_60a7f03557076'),
