(19, 1, '2021-05-20 15:16:13', '2021-05-20 15:16:13', 'Stephen Dinsmore’s paintings can be found in public and private collections both nationally and internationally. Dinsmore, a Nebraska-born artist, presents paintings that testify to the vitality of representational art as a means of communicating visual poetry. His paintings may border on the abstract being a synthesis from several sources; in other instances they may convey a more specific sense of place and time.', 'About', '', 'publish', 'closed', 'closed', '', 'about', '', '', '2021-05-27 16:56:10', '2021-05-27 21:56:10', '', 0, 'http://localhost/stephen-dinsmore/?page_id=19', 0, 'page', '', 0),
