(1039, 3, '2021-05-27 16:56:10', '2021-05-27 21:56:10', 'Stephen Dinsmore’s paintings can be found in public and private collections both nationally and internationally. Dinsmore, a Nebraska-born artist, presents paintings that testify to the vitality of representational art as a means of communicating visual poetry. His paintings may border on the abstract being a synthesis from several sources; in other instances they may convey a more specific sense of place and time.', 'About', '', 'inherit', 'closed', 'closed', '', '19-revision-v1', '', '', '2021-05-27 16:56:10', '2021-05-27 21:56:10', '', 19, 'http://localhost/stephen-dinsmore/?p=1039', 0, 'revision', '', 0),
(1040, 3, '2021-05-28 08:25:51', '2021-05-28 13:25:51', '<h4>Lorem ipsum dolor sit amet</h4>\nLorem ipsum dolor sit amet, consectetur adipiscing elit. Fringilla eu nulla dolor volutpat et. Gravida velit eu quam pretium nec curabitur amet etiam. Tellus bibendum sed duis consequat nullam diam ut. Scelerisque vulputate rhoncus aliquam, ultricies volutpat varius ante. Tortor aenean id in eget consequat velit. Viverra tellus egestas eu blandit amet integer blandit fames nisl. Massa egestas tortor integer feugiat luctus mattis. Nec quam eleifend vitae, blandit amet sit semper turpis. Consectetur aenean lacus id in pellentesque justo id mauris sed. Urna, pulvinar magna diam arcu id urna. Euismod facilisis cursus condimentum vitae nulla eget lacus aliquet blandit. Sit in gravida enim at nunc, elementum pulvinar arcu, mattis. At vulputate ac, aliquet in proin.\nSit adipiscing tempus hendrerit cras in. Nibh rutrum metus ipsum sit non. Id lobortis lorem amet massa. Fermentum ut amet, arcu porta. Felis, posuere urna, sapien sed', 'Example Blog Post', 'Something seen or remembered is the starting point. From there, painting is a process of discovery and arrival. Nuance of tone,\nexpression and the handling of materials are among those elements key to the work. It is important that the finished painting have a\nvisual “lastingness”, such that the work continues to resonate over time.', 'inherit', 'closed', 'closed', '', '17-revision-v1', '', '', '2021-05-28 08:25:51', '2021-05-28 13:25:51', '', 17, 'http://localhost/stephen-dinsmore/?p=1040', 0, 'revision', '', 0),
