(1060, 3, '2021-06-10 14:54:30', '2021-06-10 19:54:30', '<div class=\"row mt-5 sd-contact-form\">\r\n    <div class=\"col-12 mb-4 col-lg-6\">\r\n        <label class=\"pb-3\"> Your name<span class=\"required\">*</span></label>\r\n        [text* your-name]\r\n    </div>\r\n    <div class=\"col-12 mb-4 col-lg-6\">\r\n        <label class=\"pb-3\"> Your email<span class=\"required\">*</span></label>\r\n        [email* your-email]\r\n    </div>\r\n    <div class=\"col-12 mb-4 col-lg-12\">\r\n        <label class=\"pb-3\"> Subject<span class=\"required\">*</span></label>\r\n        <div class=\"select_caret_custom_container\">\r\n            [select* contact-type \"General Inquiries\" \"Commission a Painting\" \"Invite Me to Your Gallery\"]\r\n            <span class=\"custom-caret\"><i class=\"icon-caret-down\"></i></span>\r\n        </div>\r\n    </div>\r\n    <div class=\"col-12 mb-4 col-lg-12\">\r\n        <label class=\"pb-3\"> Your message (optional)</label>\r\n        [textarea your-message]\r\n    </div>\r\n    <div class=\"col-12 mb-4 col-lg-12\">\r\n        [submit \"Submit\"]\r\n    </div>\r\n</div>\n1\n[_site_title] \"[your-subject]\"\n[_site_title] <chris@millenniumweb.io>\n[_site_admin_email]\nFrom: [your-name] <[your-email]>\r\nSubject: [your-subject]\r\n\r\nMessage Body:\r\n[your-message]\r\n\r\n-- \r\nThis e-mail was sent from a contact form on [_site_title] ([_site_url])\nReply-To: [your-email]\n\n\n\n\n[_site_title] \"[your-subject]\"\n[_site_title] <chris@millenniumweb.io>\n[your-email]\nMessage Body:\r\n[your-message]\r\n\r\n-- \r\nThis e-mail was sent from a contact form on [_site_title] ([_site_url])\nReply-To: [_site_admin_email]\n\n\n\nThank you for your message. It has been sent.\nThere was an error trying to send your message. Please try again later.\nOne or more fields have an error. Please check and try again.\nThere was an error trying to send your message. Please try again later.\nYou must accept the terms and conditions before sending your message.\nThe field is required.\nThe field is too long.\nThe field is too short.\nThere was an unknown error uploading the file.\nYou are not allowed to upload files of this type.\nThe file is too big.\nThere was an error uploading the file.\nThe date format is incorrect.\nThe date is before the earliest one allowed.\nThe date is after the latest one allowed.\nThe number format is invalid.\nThe number is smaller than the minimum allowed.\nThe number is larger than the maximum allowed.\nThe answer to the quiz is incorrect.\nThe e-mail address entered is invalid.\nThe URL is invalid.\nThe telephone number is invalid.', 'Contact form 1', '', 'publish', 'closed', 'closed', '', 'contact-form-1', '', '', '2021-06-10 16:41:12', '2021-06-10 21:41:12', '', 0, 'http://localhost/stephen-dinsmore/?post_type=wpcf7_contact_form&#038;p=1060', 0, 'wpcf7_contact_form', '', 0),
